query:
fragment TokenFields on Token {
  id
  name
  symbol
  derivedETH
  tradeVolume
  tradeVolumeUSD
  untrackedVolumeUSD
  totalLiquidity
  txCount
  __typename
}

query tokens {
  tokens(block: {number: 980288}, where: {id: "0xc4daa5a9f2b832ed0f9bc579662883cd53ea9d61"}) {
    ...TokenFields
    __typename
  }
  pairs0: pairs(where: {token0: "0xc4daa5a9f2b832ed0f9bc579662883cd53ea9d61"}, first: 50, orderBy: reserveUSD, orderDirection: desc) {
    id
    __typename
  }
  pairs1: pairs(where: {token1: "0xc4daa5a9f2b832ed0f9bc579662883cd53ea9d61"}, first: 50, orderBy: reserveUSD, orderDirection: desc) {
    id
    __typename
  }
}
